import sys

def solve(input_data: str) -> str:
    data = input_data.strip().split()
    it = iter(data)
    n = int(next(it))
    m = int(next(it))
    products = []
    for _ in range(n):
        price = int(next(it))
        count = int(next(it))
        funcs = set()
        for _ in range(count):
            funcs.add(int(next(it)))
        products.append((price, funcs))

    found = False
    for i in range(n):
        if found:
            break
        for j in range(n):
            if i == j:
                continue
            price_i, functions_i = products[i]
            price_j, functions_j = products[j]
            if price_i < price_j:
                continue
            if not functions_i.issubset(functions_j):
                continue
            if price_i > price_j or len(functions_j - functions_i) > 0:
                found = True
                break
    return "Yes\n" if found else "No\n"

if __name__ == '__main__':
    print(solve(sys.stdin.read()), end='')
